function join(e,r){Swal.fire({title:"Waiting for server...",allowOutsideClick:()=>!Swal.isLoading(),onBeforeOpen:()=>(Swal.showLoading(),fetch(`/api/rbx/games/client/matchmaker?id=${e}`).then(e=>{if(!e.success)throw new Error(e.message);return e.json()}).catch(e=>{swal.fire({title:"An error occured.",text:e,type:"error"})}).then(e=>{e.payload?(Swal.fire({title:"Launching Rboxlo...",text:"This shouldn't take long.",type:"success"}),window.location.href=e.payload):Swal.fire({title:"An error occurred.",text:e.message,type:"error"})}))})}